import React from 'react';
import './projects.css';

class Projects extends React.Component {

    constructor(props) {
        super(props)
        this.state = {
            name: "Title",
            about: "About",
        }
    };

    render() {
        return (
            <div className="App">

                <div className="mockup">
                    <img className="mockupImg"></img>
                    <p>Hello</p>
                </div>

                <div className="description">
                    <h1>{this.name}</h1>
                    <p>{this.about}</p>
                </div>

            </div>
            );
    }

}

export default Projects;
